<!doctype html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width,initial-scale=1,shrink-to-fit=no">
    <meta name="theme-color" content="#000000">
    <link rel="manifest" href="/manifest.json">
    <link rel="shortcut icon" href="/favicon.ico">
    <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons%7CMaterial+Icons+Outlined">
    <link rel="stylesheet" href="https://fonts.googleapis.com/css2?family=Material+Symbols+Outlined:opsz,wght,FILL,GRAD@20..48,100..700,0..1,-50..200"/>
    <title id="page-title">GoGuardian: Organization Management</title>
    <link href="/static/css/main.6a03cee5.css" rel="stylesheet">
</head>
<body>
    <noscript>You need to enable JavaScript to run this app.</noscript>
    <div id="root"></div>
    <script type="text/javascript" src="https://service.force.com/embeddedservice/5.0/esw.min.js"></script>
    <script type="text/javascript">
        var initESW=function(e){
            embedded_svc.settings.defaultMinimizedText="Contact us!";
            embedded_svc.settings.displayHelpButton=!0;
            embedded_svc.settings.language="en";
            embedded_svc.settings.enabledFeatures=["LiveAgent"];
            embedded_svc.settings.entryFeature="LiveAgent";
            embedded_svc.init(
                "https://goguardian.my.salesforce.com",
                "https://ggcommunity.force.com/support",
                e,
                "00D41000000GNzs",
                "GoGuardian_Chat_Support",
                {
                    baseLiveAgentContentURL: "https://c.la3-c1-ia2.salesforceliveagent.com/content",
                    deploymentId: "5724N000000CocW",
                    buttonId: "5734N0000004Ree",
                    baseLiveAgentURL: "https://d.la3-c1-ia2.salesforceliveagent.com/chat",
                    eswLiveAgentDevName: "GoGuardian_Chat_Support",
                    isOfflineSupportEnabled: !0
                }
            );
        };
        
        if (window.embedded_svc) {
            initESW("https://service.force.com");
        } else {
            var s = document.createElement("script");
            s.setAttribute("src", "https://goguardian.my.salesforce.com/embeddedservice/5.0/esw.min.js");
            s.onload = function() {
                initESW(null);
            };
            document.body.appendChild(s);
        }
    </script>
    <script type="text/javascript" src="/static/js/main.fa7b5d6c.js"></script>
</body>
</html>
